import re

RE_STR = re.compile(r'[\w.-]+')
RE_PUNCTUATION = re.compile(r'[^\w.-]+')


def regular(contents: list):
    regulars = {}
    for index, content in enumerate(contents):
        regexs = ''
        while content:
            char: str = content[0]
            if char.isalnum() or char in {'.', '-'}:
                regex = RE_STR
            else:
                regex = RE_PUNCTUATION
            re_match = regex.match(content)
            content = content[re_match.end():]
            if regex == RE_PUNCTUATION:
                regexs += re_match.group()
            else:
                regexs += regex.pattern
        regulars[regexs] = contents[index]
    return regulars


